import {BrowserRouter} from 'react-router-dom';
import {Navbar} from './nav';

export class App extends React.Component {
  render() {
    return (

      <BrowserRouter>
      <h1>
      <Navbar />
      </h1>
      <Switch>
        <Route path='/' component={Dashboard} />
      </Switch>
      </BrowserRouter>

    );
  }
};
